import './Header.scss'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass, fa } from '@fortawesome/free-solid-svg-icons';


export default function Header() {

    let searchResult

    return (
        <div className="header">
            <span className='header__logo'>Vu Huy Bui</span>
            <div className='header__wrap'>
                <div className='header__navbar'>
                    <span className='header__nav'>Home</span>
                    <span className='header__nav'>About</span>
                    <span className='header__nav'>Projects</span>
                    <span className='header__nav'>Contacts</span>
                    
                </div>
                <div className='header__search-icon'>
                    <FontAwesomeIcon icon={faMagnifyingGlass} />
                </div>
            </div>
            <div className='header__search'>
                <input 
                placeholder='Search anything' 
                className='header__search-bar' 
                onChange={e => { 
                    searchResult = e.target.value
                    console.log(searchResult);
                }} value={searchResult}
                ></input>
                <div className='header_search-close'>

                </div>
            </div>
        </div>
    )
}
